        def on_click_evaluate_in_evaluation_form(self):
                self.MessageOnEvaluationForm.setText(self.Leader+" has been evaluated.")
                self.showmessageandhidemessage(self.MessageOnEvaluationForm)
                con = sql.connect(host='localhost', user='root', password='', db='fcs_writer')
                cur = con.cursor()
                cur.execute("select writer_ID from writer where writer_JobRole = %s AND writer_Team = %s",('Team Leader', self.Writer_Team_Name))
                record = cur.fetchall()
                Leader_ID = record[0][0]
                cur.execute("insert into evaluation (Leader_ID_FK, Writer_ID_FK, P_and_R_Time, Team_Spirit, Instruction, Initiatives, Attitude_and_Behaviour, In_and_out, Coordination_and_FollowUp, Focused_to_new_learning, Planning_and_Management, Team_Management, Honesty_and_Empathy) values (%s,%s,%s,%s,%s,%s,%s,%s,%s,%s,%s,%s,%s)",(
                        str(Leader_ID),
                        str(self.writer_id),
                        str(self.lineEdit_3.text()),  
                        str(self.lineEdit_4.text()),  
                        str(self.lineEdit_5.text()),  
                        str(self.lineEdit_6.text()),  
                        str(self.lineEdit_7.text()),  
                        str(self.lineEdit_8.text()),  
                        str(self.lineEdit_9.text()),  
                        str(self.lineEdit_10.text()),  
                        str(self.lineEdit_11.text()),  
                        str(self.lineEdit_12.text()),  
                        str(self.lineEdit_13.text()),  
                        ))
                con.commit()
                con.close()
        def on_click_send_now_on_contact_us(self):
                self.Animate_contact_us_content = QPropertyAnimation(self.ContentOnContactUs, b'maximumWidth')
                self.Animate_contact_us_content.setDuration(1000)
                self.Animate_contact_us_content.setStartValue(self.ContentOnContactUs.width())
                self.Animate_contact_us_content.setEndValue(0)
                self.Animate_contact_us_content.setEasingCurve(QtCore.QEasingCurve.InOutQuart)
                
                self.Animate_close_button_height = QPropertyAnimation(self.ContactUsBtn, b'maximumHeight')
                self.Animate_close_button_height.setDuration(1000)
                self.Animate_close_button_height.setStartValue(self.ContactUsBtn.height())
                self.Animate_close_button_height.setEndValue(0)
                self.Animate_close_button_height.setEasingCurve(QtCore.QEasingCurve.InOutQuart)
                
                self.Animate_close_button_width = QPropertyAnimation(self.ContactUsBtn, b'maximumWidth')
                self.Animate_close_button_width.setDuration(1000)
                self.Animate_close_button_width.setStartValue(self.ContactUsBtn.width())
                self.Animate_close_button_width.setEndValue(0)
                self.Animate_close_button_width.setEasingCurve(QtCore.QEasingCurve.InOutQuart)

                self.Group_on_contact_us = QSequentialAnimationGroup()
                self.Group_on_contact_us.addAnimation(self.Animate_contact_us_content)
                self.Group_on_contact_us.addAnimation(self.Animate_close_button_height)
                self.Group_on_contact_us.addAnimation(self.Animate_close_button_width)
                self.Group_on_contact_us.start()
                self.Group_on_contact_us.finished.connect(self.show_WriterDashboard)
                self.MessageOnContactUs.setText("Your message has been sent to Authority. Thank you for contacting us.")
                self.showmessageandhidemessage(self.MessageOnContactUs)
